class Solution:
    def totalCost1(self, costs: List[int], k: int, candidates: int) -> int:  # 此题用二分不能通过，后来换成下面的堆排
        n = len(costs)
        costs = [[costs[i], i] for i in range(n)]
        ans = 0
        if n >= candidates * 2:
            cdd = costs[:candidates] + costs[n - candidates:]
        else:
            cdd = costs
        heapq.heapify(cdd)
        # cdd.sort()
        i, j = candidates, n - candidates - 1
        for ii in range(k):
            ans += cdd[0][0]
            if ii < n - candidates * 2:
                if cdd[0][1] < i:
                    del (cdd[0])
                    bisect.insort_left(cdd, costs[i])
                    i += 1
                else:
                    del (cdd[0])
                    bisect.insort_left(cdd, costs[j])
                    j -= 1
            else:
                del (cdd[0])
        return ans

    def totalCost(self, costs: List[int], k: int, candidates: int) -> int:
        n = len(costs)
        costs = [[costs[i], i] for i in range(n)]
        ans = 0
        if n >= candidates * 2:
            cdd = costs[:candidates] + costs[n - candidates:]
        else:
            cdd = costs
        heapq.heapify(cdd)
        # cdd.sort()
        i, j = candidates, n - candidates - 1
        for ii in range(k):
            cur = heapq.heappop(cdd)
            ans += cur[0]
            if ii < n - candidates * 2:
                if cur[1] < i:
                    # del (cdd[0])
                    heapq.heappush(cdd, costs[i])
                    # bisect.insort_left(cdd, costs[i])
                    i += 1
                else:
                    # del (cdd[0])
                    heapq.heappush(cdd, costs[j])
                    # bisect.insort_left(cdd, costs[j])
                    j -= 1
            # else:
            #     del (cdd[0])
        return ans

